import React from 'react';

function Resume() {
  // Replace with your Google Drive PDF link
  const googleDrivePdfUrl = 'https://drive.google.com/file/d/15kfZ5v5DuzukfjjvzkgPRcf7vX99xSW6/view?usp=sharing/';

  return (
    <div className="resume">
      <h1>My Resume</h1>
      <div className="resume-content">
        <iframe
          src={googleDrivePdfUrl}
          title="Resume"
          width="100%"
          height="800px"
          frameBorder="0"
          scrolling="auto"
        ></iframe>

        <div className="download-link">
          <a href={googleDrivePdfUrl.replace('/preview', '/view')} target="_blank" rel="noopener noreferrer" download="resume.pdf">
            <button>Download Resume</button>
          </a>
        </div>
      </div>
    </div>
  );
}

export default Resume;
